import React, { useState } from "react";


function DigitalProgramming() {
    const DigitalProgramming = [
        {
                YoutubeId: "C1a1TK_2KPA", category: "YA", Tags: "#Halloween"
        }
    ]

    function programmingDataRow({ProgrammingData}) {
        
        return (
            <p>

                {ProgrammingData.YoutubeId}
            </p>
        );
    }

    function ShowDigitalProgrammingData()
    {
        const data = [];
        DigitalProgramming.forEach((ProgrammingData) => {
            data.push(<programmingDataRow Data={ProgrammingData} />);
        });
        return(data);
    }
    return (
        <div className="DigitalProgramming">
            <h1> DigitalProgramming Page </h1>

            <ShowDigitalProgrammingData /> 
        </div>
    );
}

export default DigitalProgramming;
